import React from 'react'


function Salaries(props){
  return(
    <li>
      <h2>{props.jobName}</h2>
      <p>25th Percentile: {Math.round(props.jobSalary25)} - 50th Percentile: {Math.round(props.jobSalary50)} - 75th percentile: {Math.round(props.jobSalary75)}</p>
    </li>
  )
}

export default Salaries;
